const light = {
  primaryColor: "#6100ee",
  bgColor: "#ffffff",
  textColor: "#222",
  roundness: 5,
  breakpoints: {
    sm: 540,
    md: 720,
    lg: 960,
    xl: 1140,
    xxl: 1320,
  },
};

const dark = {
  ...light,
  bgColor: "#121212",
  textColor: "#e1e1e1",
};

export default {
  light,
  dark,
};
